import { Component, Prop, Event, EventEmitter, h } from '@stencil/core';

@Component({
  tag: 'fw-file-uploader-progress',
  styleUrl: 'file-uploader-progress.scss',
  shadow: true,
})
export class FileUploaderProgress {
  /**
   * file Id
   */
  @Prop() fileId!: number;

  /**
   * file name
   */
  @Prop() fileName = '';

  /**
   * file upload progress
   */
  @Prop() progress = 0;

  /**
   * error text for the file upload
   */
  @Prop() error = '';

  /**
   * retryUpload event to emit in case of a retry
   */
  @Event() fwRetryUpload: EventEmitter;

  /**
   * private
   * @param fileId
   */
  retryFileUpload(fileId) {
    this.fwRetryUpload.emit({ fileId });
  }

  /**
   * render
   * @returns {JSX.Element}
   */
  render() {
    const hasError = this.error.trim() !== '' ? true : false;
    return (
      <div class='progress-content'>
        <div class='progress-content-icon'>
          <svg
            width='26'
            height='26'
            viewBox='0 0 26 26'
            fill='none'
            xmlns='http://www.w3.org/2000/svg'
          >
            <rect width='26' height='26' fill='url(#pattern0)' />
            <defs>
              <pattern
                id='pattern0'
                patternContentUnits='objectBoundingBox'
                width='1'
                height='1'
              >
                <use
                  xlinkHref='#image0_1441_50556'
                  transform='scale(0.00195312)'
                />
              </pattern>
              <image
                id='image0_1441_50556'
                width='512'
                height='512'
                xlinkHref='data:image/png;base64,'
              />
            </defs>
          </svg>
        </div>
        <div class='progress-content-file'>
          <div class='progress-content-file-name'>{this.fileName}</div>
          <div class='progress-content-file-percentage'>
            {hasError ? (
              <fw-icon
                size={10}
                name='sync'
                color='#2c5cc5'
                onClick={() => this.retryFileUpload(this.fileId)}
              ></fw-icon>
            ) : (
              this.progress + '%'
            )}
          </div>
          <div class='progress-content-progress-bar'>
            <div
              class='progress-content-progress-bar-fill'
              style={{
                width: hasError ? '0%' : this.progress + '%',
              }}
            ></div>
          </div>
          {hasError && <div class='progress-content-error'>{this.error}</div>}
        </div>
      </div>
    );
  }
}
